import { useState, useEffect } from "react";

export function HandleFetch (url, action) {
    return function (dispatch) {
        useEffect(() => {
            fetch ('https://jsonplaceholder.typicode.com/')
            .then(response => response.json())
            .then(json => dispatch(action(json)))
        }, [])
    }
}
